import React from 'react';
import { Grid } from '@material-ui/core';

const RestaurantCard = (props) => {
    const restaurant = props.restaurant;
    return (
        <Grid container item xs={12} sm={4} spacing={15}>
            <div className="card" onClick={e => window.open(restaurant.url, "_blank")}>
                <img src={restaurant.imageUrl} alt={restaurant.name}/>
                <div className="data" style={{ userSelect: "none" }}>
                    <h1 className="businessName" id="product-sans">{restaurant.name}</h1>
                    <h3 className="businessAddress">{restaurant.address}</h3>
                    <div className="rating">
                        <h1 className="businessRating">{restaurant.rating} ⭐️</h1>
                        <div className="space"/>
                        <h1 className="businessPrice">${restaurant.price}</h1>
                    </div>
                </div>
            </div>
        </Grid>
    );
}

export default RestaurantCard;
